function calculateIRR(cashflows: number[]): number {
  let rate = 0.1;
  for (let i = 0; i < 100; i++) {
    const npv = cashflows.reduce((sum, cf, t) =>
      sum + cf / Math.pow(1 + rate, t), 0);
    const dnpv = cashflows.reduce((sum, cf, t) =>
      sum - t * cf / Math.pow(1 + rate, t + 1), 0);
    rate -= npv / dnpv;
  }
  return rate;
}
